        <p class="inline mr-2 font-bold" arial-label="total amount of the order">
          Total: {{ totalBreakdown?.total ?? -1 }}
        </p>
      </section>
    </div>
  `,
  styles: [
    `
      :host {
        display: block;
      }
    `,
  ],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class FoodTotalComponent implements OnInit, OnChanges {
  @Input()
  public currency: string
  @Output()
  public getCheck = new EventEmitter<number>()
  @Input()
  public isFoodOrdered: boolean
  @Input()
  public tips: number[]
  @Input()
  public totalBreakdown: TotalCost

  public form: FormGroup

  constructor(private fb: FormBuilder) {}

  public get tip(): number {
    const cents = 100
    const control = this.form.get('tip') as FormControl
    if (!control) {
      return 0
    }

    return (control.value as number) / cents
  }

  public ngOnInit(): void {
    console.log('totalBreakdown', this.totalBreakdown)

    this.form = this.fb.group({
      tip: new FormControl(this.tips[0], { validators: [Validators.required] }),
    })
  }

  ngOnChanges(changes: SimpleChanges): void {
    const { totalBreakdown } = changes
    if (totalBreakdown) {
      console.log('currentValue', totalBreakdown.currentValue)
      const currentValue = totalBreakdown.currentValue
      this.totalBreakdown.subTotal = currentValue.subtotal ?? 0
      this.totalBreakdown.total = currentValue.total ?? 0
      this.totalBreakdown.totalTip = currentValue.totalTip ?? 0
    }
  }
}

